	"sap/ushell/plugins/rta/i18n/i18n_ko.properties":'#\n#Mon Mar 29 18:19:17 UTC 2021\nHEADER_FLEX_DISABLED=정보\nTIT_UNSUPPORTED_BROWSER=지원되지 않는 브라우저\nAPP_TITLE=RTA FLP 플러그인\nMSG_UNSUPPORTED_BROWSER=죄송합니다. 브라우저가 지원되지 않습니다. Google Chrome 또는 Microsoft Internet Explorer(버전 10 이상)를 사용하십시오.\nMSG_FLEX_DISABLED=이 어플리케이션은 적용할 수 없습니다. 자세한 내용은 [여기](https\\://help.sap.com/viewer/4fc8d03390c342da8a60f8ee387bca1a/latest/en-US/ef97b2485aa34a8890f4d51e5c2b15a8.html)를 참조하십시오.\nRTA_BUTTON_TEXT=UI 적용\nTECHNICAL_ERROR=기술적 오류가 발생했습니다. 지원 팀에 문의하십시오.\nERROR_TITLE=UI 적용을 시작할 수 없음\n',
